INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<?php \r\nglobal $user;\r\n\r\n   if ($user->uid == 1) {\r\n     echo \'Styles Override\';\r\n  }\r\n\r\n?>\r\n\r\n<style>\r\n* .error {display: none !important;}\r\n.filter-wrapper {display: none}\r\n#admin-menu-icon {display:none;}\r\n.view-picks-template .views-row, .view-shows .views-row, .field-name-field-matches > .field-items > .field-item { margin: 5px 0 0; border-bottom: 1px solid #ddd; }\r\n\r\n.field-name-og-user-node .field-label {\r\n    font-size: 24px;\r\n    color: #333;\r\n}\r\n\r\n.field-item a {\r\n    color: #0c59b1;\r\n    padding-left: 13px;\r\n}\r\n\r\n.field-name-og-user-node .field-item a {\r\n   background: url(\'/sites/default/files/list.png\') left center / 20px auto no-repeat;\r\n   font-size: 16px;\r\n   padding-left: 25px;\r\n}\r\n\r\n\r\n.node-match .field-type-entityreference, .view-matches .views-field, .view-shows .views-field, .view-picks-template form > div {width:auto;}\r\n\r\ninput[type=\"submit\"] {\r\n    float: left;\r\n    clear: both;\r\n    margin: 10px 0;\r\n}\r\n#comments {\r\nfloat: left;\r\nwidth: 100%;\r\n}\r\n\r\naside {    \r\n    background: #f8f8f8;\r\n    border-radius: 5px;\r\n    -webkit-border-radius: 5px;\r\n}\r\n</style>\r\n\r\n<?php \r\n\r\n   if ($user->uid == 1) { ?>\r\n<style>\r\n/** admin styles **/\r\n.filter-wrapper {display:block;}\r\n#admin-menu-icon {display:block;}\r\n\r\n</style>\r\n\r\n<?php } ?>\r\n', 'common styles', 'php_code'),
(6, '<table>\r\n<thead>\r\n  <td><strong>Name</strong></td>\r\n  <td><strong>Score</strong></td>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n  <td>Admin</td>\r\n  <td><strong>0</strong></td>\r\n</tr>\r\n<tr>\r\n  <td>Someone</td>\r\n  <td><strong>0</strong></td>\r\n</tr>\r\n<tr>\r\n  <td>Boris</td>\r\n  <td><strong>0</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<style>\r\ntd {background: #eee; border: 2px solid #fff;}\r\n</style>', 'pool leaderboard', 'full_html'),
(7, '<?php\r\n  global $user;\r\n?>\r\n<div>\r\n  <h2 style=\"font-size: 24px; font-weight:bold; text-transform: uppercase;\">Hello <?php echo $user->name;  ?></h2>\r\n</div>', 'hello user', 'ds_code'),
(8, '<div style=\"display: block;\" class=\"w100 left clearfix\">\r\n  <div class=\"m10-0 p5 left w40\">\r\n    <a href=\"/previous-shows\">Previous Shows</a>\r\n  </div>\r\n  <div class=\"m10-0 p5 left w40\">\r\n    <a href=\"/future-shows\">Future Shows</a>\r\n  </div>\r\n</div>', 'front page buttons', 'php_code');
